import React from 'react';
import {ReactComponent as GitHubIcon} from './assets/img/github.svg'

function App() {
  return (
    <header>
      <nav>
        <div>
          <h1>Robert's DSMovie</h1>
          <a href='https://github.com/robertteixeira/dsmovie'>
            <div>
              <GitHubIcon/>
              <p>/Robert's Dev</p>
            </div>
          </a>
        </div>
      </nav>
    </header>
  );
}

export default App;
